import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import './PasswordListPage.css'; // Assurez-vous d'importer votre fichier CSS

function PasswordListPage() {
    const [showForm, setShowForm] = useState(false);
    const [newPasswordUsername, setNewPasswordUsername] = useState('');
    const [newPasswordPassword, setNewPasswordPassword] = useState('');
    const [newPasswordWebsite, setNewPasswordWebsite] = useState('');
    const [generateStrongPassword, setGenerateStrongPassword] = useState(false);
    const [passwordLength, setPasswordLength] = useState(12);
    const [includeNumbers, setIncludeNumbers] = useState(false);
    const [includeSpecialChars, setIncludeSpecialChars] = useState(false);
    const [passwords, setPasswords] = useState([]);

    useEffect(() => {
        fetch('http://localhost:3001/passwords', {
            headers: {
                'Authorization': `Bearer ${localStorage.getItem('token')}`
            }
        })
            .then(response => {
                if (!response.ok) {
                    throw new Error('Failed to fetch passwords');
                }
                return response.json();
            })
            .then(data => {
                setPasswords(data);
            })
            .catch(error => {
                console.error('Error fetching passwords:', error);
            });
    }, []);

    const handleAddPassword = async () => {
        // La fonction pour ajouter un mot de passe reste inchangée
    };

    const handleDeletePassword = async (passwordId) => {
        // La fonction pour supprimer un mot de passe reste inchangée
    };

    const handleEditPassword = async (passwordId, updatedUsername, updatedPassword, updatedWebsite) => {
        // La fonction pour modifier un mot de passe reste inchangée
    };

    // Fonction pour ouvrir/fermer le formulaire
    const toggleForm = () => {
        setShowForm(!showForm);
    };

    return (
        <div>
            <h2>Liste des mots de passe</h2>
            <button className="open-button" onClick={toggleForm}>Ajouter un mot de passe</button>
            {showForm && (
                <div className="form-popup">
                    <form className="form-container">
                        <h1>Ajouter un mot de passe</h1>
                        <label htmlFor="username"><b>Nom d'utilisateur</b></label>
                        <input type="text" placeholder="Nom d'utilisateur" value={newPasswordUsername} onChange={(e) => setNewPasswordUsername(e.target.value)} required />

                        <label htmlFor="password"><b>Mot de passe</b></label>
                        <input type="password" placeholder="Mot de passe" value={newPasswordPassword} onChange={(e) => setNewPasswordPassword(e.target.value)} required />

                        <label htmlFor="website"><b>Site web</b></label>
                        <input type="text" placeholder="Site web" value={newPasswordWebsite} onChange={(e) => setNewPasswordWebsite(e.target.value)} required />

                        <label>
                            Générer un mot de passe fort :
                            <input type="checkbox" checked={generateStrongPassword} onChange={(e) => setGenerateStrongPassword(e.target.checked)} />
                        </label>
                        {generateStrongPassword && (
                            <div>
                                <label>
                                    Longueur du mot de passe :
                                    <input type="number" value={passwordLength} onChange={(e) => setPasswordLength(parseInt(e.target.value))} />
                                </label>
                                <label>
                                    Inclure des chiffres :
                                    <input type="checkbox" checked={includeNumbers} onChange={(e) => setIncludeNumbers(e.target.checked)} />
                                </label>
                                <label>
                                    Inclure des caractères spéciaux :
                                    <input type="checkbox" checked={includeSpecialChars} onChange={(e) => setIncludeSpecialChars(e.target.checked)} />
                                </label>
                            </div>
                        )}
                        <button type="button" className="btn" onClick={handleAddPassword}>Ajouter le mot de passe</button>
                        <button type="button" className="btn cancel" onClick={toggleForm}>Fermer</button>
                    </form>
                </div>
            )}
            <h3>Liste des mots de passe</h3>
            <ul>
                {passwords.map(password => (
                    <li key={password.id}>
                        <strong>{password.username}</strong>: {password.password} - <em>{password.website}</em>
                        <button onClick={() => handleDeletePassword(password.id)}>Supprimer</button>
                        <button onClick={() => handleEditPassword(password.id, 'Nouveau nom', 'Nouveau mot de passe', 'Nouveau site')}>Modifier</button>
                    </li>
                ))}
            </ul>
            <Link to="/dashboard">Retour au tableau de bord</Link>
        </div>
    );
}

export default PasswordListPage;
